import React from "react";

const Navbar= ()=> {
  return (
    <navbar>
      <h4 className="logo">Health-provider</h4>
      <div className="reg-side">
        <h4>
          <a>Log in</a>
        </h4>
        <a>Sign up</a>
      </div>
    </navbar>
  );
}

export default Navbar
